'','2020-03-29 12:25:41','2020-03-29 12:25:41','',0,'http://localhost/dukcapil/wp-content/uploads/2020/03/PointOfSale-Trello.png',0,'attachment','image/png',0),(20,1,'2020-03-29 12:25:47','2020-03-29 12:25:47','http://localhost/dukcapil/wp-content/uploads/2020/03/cropped-PointOfSale-Trello.png','cropped-PointOfSale-Trello.png','','inherit','open','closed','','cropped-pointofsale-trello-png','','','2020-03-29 12:25:47','2020-03-29 12:25:47','',0,'http://localhost/dukcapil/wp-content/uploads/2020/03/cropped-PointOfSale-Trello.png',0,'attachment','image/png',0),(25,1,'2020-04-01 14:38:42','2020-04-01 14:38:42','<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>PENERBITAN KTP-el BARU</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Telah berusia 17 (tujuh belas ) tahun, sudah kawin atau pernah kawin;</li><li> Fotocopy Kartu Keluarga 2 lembar;</li><li> Melakukan perekaman bio metrik </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>PENERBITAN KTP-el KARENA PINDAH DATANG</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Surat keterangan pindah dari DisdukcapilKab/Kota atau UPT DisdukcapilKab/Kota daerah asal; dan </li><li> Kartu Keluartga (KK) </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>PENERBITAN KTP-el KARENA PINDAH DATANG BAGI WNI YANG DATANG DARI LUAR NEGERI</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Surat keterangan pindah dari Perwakilan RI; dan</li><li> Kartu Keluartga (KK) </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>PENERBITAN KTP-el KARENA PERUBAHAN DATA</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Fotocopy Kartu Keluarga 2 (dua) lembar; </li><li>KTP-el lama;</li><li> Surat keterangan/bukti perubahan peristiwa Kependudukan dan Peristiwa Penting </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>PENERBITAN KTP-el KARENA HILANG ATAU RUSAK</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Surat keterangan hilang dari kepolisian;</li><li> KTP-el yang rusak;</li><li> Fotocopy Kartu Keluarga 2 lembar </li></ol>\n<!-- /wp:list -->','Kartu Tanda Penduduk (KTP)','','publish','closed','closed','','kartu-tanda-penduduk','','','2020-04-06 22:51:34','2020-04-06 22:51:34','',0,'http://localhost/dukcapil/?page_id=25',0,'page','',0),(26,1,'2020-04-01 14:38:42','2020-04-01 14:38:42','','Kartu Tanda Penduduk','','inherit','closed','closed','','25-revision-v1','','','2020-04-01 14:38:42','2020-04-01 14:38:42','',25,'http://localhost/dukcapil/index.php/2020/04/01/25-revision-v1/',0,'revision','',0),(27,1,'2020-04-01 14:39:15','2020-04-01 14:39:15','<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><br>PENERBITAN KARTU KELUARGA (KK) BARU</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>Buku nikah/kutipan akta perkawinan atau kutipan akta perceraian.</li><li>Surat keterangan pindah/surat keterangan pindah datang bagi penduduk yang pindah dalam wilayah Negara kesatuan Republik Indonesia;</li><li>Surat keterangan pindah luar negeri yang diterbitkan oleh DisdukcapilKab/Kota bagi WNI yang datang dari luar wilayah NKRI karena pindah;</li><li> Surat keterangan pengganti tanda identitas bagi penduduk rentas Aministrasi Kependudukan; </li><li> Petikan Keputusan Presiden tentang pewarganegaraan dan berita acara pengucapan sumpah atau pernyataan janji setia bagi Penduduk WNI yang semula berkewarganegaraan asing atau petikan Keputusan Menteri yang menyelengarakan urusan pemerintahan dibidang hukum tentang perubahan status kewarganegaraan; </li><li> Mengisi formulir F1.01 dari kelurahan/Desa yang ditanda tangani Kepala Keluarga; </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>PENERBITAN KK KARENA PERUBAHAN DATA</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Mengisi Form F-1.03 dari Desa/kelurahan; </li><li> Kartu Keluarga (KK) Lama Yang Asli;</li><li> Surat Keterangan/Bukti Perubahan Peristiwa Penting Dan Peristiwa Kependudukan (Foto Copy Ijazah SD, SMP, SMA atau Ijazah Terakhir / Akta Kelahiran/ SK Bagi Yang PNS/ Pernyataan Tidak Sekolah); </li><li> Surat Pernyataan Perubahan/Form 109 Yang Ditanda Tangani Kepala Keluarga;</li><li> Fotocopy Buku Nikah/Akta Nikah/Akta Cerai;</li><li> Form F1.05 Surat Petanggung Jawaban Mutlak (SPTJM) Perkawinan/Perkawinan Belum Tercatat. (Download). Bagi Penduduk Yang Tidak Memiliki Buku Nikah/Akta Nikah/Akta Cerai. </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>PENERBITAN KK KARENA PENAMBAHAN ANGGOTA KELUARGA</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Mengisi Form F-1.03 Dari Desa/Kelurahan; </li><li> Kartu Keluarga (KK) Yang Asli; </li><li> Surat Ket. Lahir Dari Puskesmas, Rumah Sakit Yang Ditanda Tangani Oleh Dokter Atau Bidan Yang Manangani; </li><li> Fotocopy Buku Nikah/Akta Nikah/Akta Cerai; </li><li> Form F1.05 Surat Petanggung Jawaban Mutlak (SPTJM) Perkawinan/Perkawinan Belum Tercatat. (Download). Bagi Penduduk Yang Tidak Memiliki Buku Nikah/Akta Nikah/Akta Cerai;</li><li> Fotocopy Ijazah Bagi Yang Sudah Tamat Sekolah/Surat Pernyataan Tidak Sekolah;  </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>PENERBITAN KARTU KELUARGA (KK) KARENA PISAH KK</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Mengisi Form F-1.01 dari Desa/kelurahan; </li><li> Surat Keterangan Pindah Datang dari Desa/kelurahan; </li><li> Kartu Keluarga Asli Orang Tua dan Mertua; </li><li> Surat Keterangan/Bukti Perubahan Peristiwa Penting Dan Peristiwa Kependudukan (Foto Copy Ijazah SD, SMP, SMA atau Ijazah Terakhir / Akta Kelahiran/ SK Bagi Yang PNS/ Pernyataan Tidak Sekolah); </li><li> Fotocopy Fotocopy buku nikah/akta nikah/akta cerai; </li><li> Form F1.05 Surat Petanggung Jawaban Mutlak (SPTJM) Perkawinan/Perkawinan Belum Tercatat. (Download). Bagi Penduduk Yang Tidak Memiliki Buku Nikah/Akta Nikah/Akta Cerai </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>PENERBITAN KARTU KELUARGA (KK) KARENA HILANG ATAU RUSAK</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Surat Keterangan hilang dari Kepolisian atau KK yang rusak; </li><li> Fotocopi KTP-el </li></ol>\n<!-- /wp:list -->','Kartu Keluarga','','publish','closed','closed','','kartu-keluarga','','','2020-04-06 23:04:33','2020-04-06 23:04:33','',0,'http://localhost/dukcapil/?page_id=27',0,'page','',0),(28,1,'2020-04-01 14:39:15','2020-04-01 14:39:15','','Kartu Keluarga','','inherit','closed','closed','','27-revision-v1','','','2020-04-01 14:39:15','2020-04-01 14:39:15','',27,'http://localhost/dukcapil/index.php/2020/04/01/27-revision-v1/',0,'revision','',0),(29,1,'2020-04-01 14:39:30','2020-04-01 14:39:30','<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\">SYARAT PENERBITAN AKTA KELAHIRAN</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>Keterangan Kelahiran dari Bidan/Dokter/SPTJM;</li><li>Fotocopy Kartu Keluarga (KK);</li><li> Fotocopy KTP Ayah dan Ibu;</li><li> Fotocopy Buku Nikah Orang Tua Kandung Yang telah di legalisir/SPTJM; </li><li> Fotocopy Izasah Bagi Yang Sudah tamat Pendidikan;</li><li> Foto copy KTP 2 Orang Saksi </li></ol>\n<!-- /wp:list -->','Akta Kelahiran','','publish','closed','closed','','akta-kelahiran','','','2020-04-06 23:05:41','2020-04-06 23:05:41','',0,'http://localhost/dukcapil/?page_id=29',0,'page','',0),(30,1,'2020-04-01 14:39:30','2020-04-01 14:39:30','','Akta Kelahiran','','inherit','closed','closed','','29-revision-v1','','','2020-04-01 14:39:30','2020-04-01 14:39:30','',29,'http://localhost/dukcapil/index.php/2020/04/01/29-revision-v1/',0,'revision','',0),(31,1,'2020-04-01 14:39:43','2020-04-01 14:39:43','<!-- wp:paragraph -->\n<p><strong>SYARAT PENERBITAN AKTA KEMATIAAN</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"> PENCATATAN KEMATIAN UNTUK WARGA NEGARA INDONESIA (WNI) </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Surat Keterangan Kematian dari Kelurahan/Desa;</li><li> Asli dan Fotocopy Kartu Keluarga (KK) dan KTP-EL Almarhum dan Pemohon; </li><li> Asli Dan Fotocopy Kutipan Akta Perkawinan/Akta Nikah, Dalam Hal Yang Meninggal Sudah Kawin; </li><li> Asli dan Fotocopy Kutipan Akta Kelahiran yang Meninggal.  </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"> PENCATATAN KEMATIAN UNTUK WARGA NEGARA ASING (WNA) </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Surat Keterangan Kematian dari Rumah Sakit, Puskesmas, atau Visum Dokter; </li><li> Surat Keterangan Kematian dari Rumah Sakit, Puskesmas, atau Visum Dokter; </li><li> Asli dan Fotocopy SKTT dan SKSKPS bagi Pemegang ITAS; </li><li> Asli dan Fotocopy Paspor bagi Orang Asing yang Memilik Izin Kunjungan;</li><li> Asli dan Fotocopy Kutipan Akta Perkawinan, Dalam Hal Yang Meninggal Sudah Kawin; </li><li> Asli dan Fotocopy Kutipan Akta Kelahiran yang Meninggal. </li></ol>\n<!-- /wp:list -->','Akta Kematian','','publish','closed','closed','','akta-kematian','','','2020-04-06 23:16:01','2020-04-06 23:16:01','',0,'http://localhost/dukcapil/?page_id=31',0,'page','',0),(32,1,'2020-04-01 14:39:43','2020-04-01 14:39:43','','Akta Kematian','','inherit','closed','closed','','31-revision-v1','','','2020-04-01 14:39:43','2020-04-01 14:39:43','',31,'http://localhost/dukcapil/index.php/2020/04/01/31-revision-v1/',0,'revision','',0),(33,1,'2020-04-01 14:39:54','2020-04-01 14:39:54','<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\"><strong>SYARAT PENERBITAN AKTA NIKAH</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Surat Keterangan Telah Terjadinya Perkawinan Dari Pemuka Agama/Pendeta Atau Surat Perkawinan Penganut Kepercayaan;</li><li> Fotocopy KTP Suami Dan Istri;</li><li> Pas Foto Berwarna Suami Dan Istri;</li><li> Kutipan Akta Kelahiran Suami Dan Istri;</li><li> Paspor Bagi Suami Atau Istri Orang Asing </li></ol>\n<!-- /wp:list -->','Akta Nikah','','publish','closed','closed','','akta-nikah','','','2020-04-06 23:11:54','2020-04-06 23:11:54','',0,'http://localhost/dukcapil/?page_id=33',0,'page','',0),(34,1,'2020-04-01 14:39:54','2020-04-01 14:39:54','','Akta Nikah','','inherit','closed','closed','','33-revision-v1','','','2020-04-01 14:39:54','2020-04-01 14:39:54','',33,'http://localhost/dukcapil/index.php/2020/04/01/33-revision-v1/',0,'revision','',0),(35,1,'2020-04-01 14:40:07','2020-04-01 14:40:07','<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\">Penerbitan KIA bagi Penduduk WNI yang berumur kurang dari 17 (tujuh belas) tahun dan belum kawin dengan memenuhi persyaratan : </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Fotocopy Kutipan Akta Kelahiran 2 Lembar;</li><li> Fotocopy Kartu Keluarga  2 Lembar; </li><li> Fotocopy KTP-el orang tua/wali  2 Lembar ;</li><li> Pas foto berwarna ukuran 3 x 4 sebanyak 2 (dua) lembar (untuk anak usia 5 s/d 17 tahun kurang 1 (satu) hari);</li><li> Usia kurang dari 5 (Lima)  tidak pakai Pas foto </li></ol>\n<!-- /wp:list -->','Kartu Identitas Anak (KIA)','','publish','closed','closed','','kartu-identitas-anak','','','2020-04-07 06:15:34','2020-04-07 06:15:34','',0,'http://localhost/dukcapil/?page_id=35',0,'page','',0),(36,1,'2020-04-01 14:40:07','2020-04-01 14:40:07','','Kartu Identitas Anak','','inherit','closed','closed','','35-revision-v1','','','2020-04-01 14:40:07','2020-04-01 14:40:07','',35,'http://localhost/dukcapil/index.php/2020/04/01/35-revision-v1/',0,'revision','',0),(37,1,'2020-04-01 14:41:46','2020-04-01 14:41:46','<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-bac