eading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Fotocopy Kartu Keluarga 2 (dua) lembar; </li><li>KTP-el lama;</li><li> Surat keterangan/bukti perubahan peristiwa Kependudukan dan Peristiwa Penting </li></ol>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2><strong>PENERBITAN KTP-el KARENA HILANG ATAU RUSAK</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Surat keterangan hilang dari kepolisian;</li><li> KTP-el yang rusak;</li><li> Fotocopy Kartu Keluarga 2 lembar </li></ol>\n<!-- /wp:list -->','Kartu Tanda Penduduk (KTP)','','inherit','closed','closed','','25-revision-v1','','','2020-04-06 22:46:51','2020-04-06 22:46:51','',25,'http://117.53.47.16/index.php/2020/04/06/25-revision-v1/',0,'revision','',0),(67,1,'2020-04-06 22:49:38','2020-04-06 22:49:38','<!-- wp:heading -->\n<h2>Penerbitan KIA bagi Penduduk WNI yang berumur kurang dari 17 (tujuh belas) tahun dan belum kawin dengan memenuhi persyaratan : </h2>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li> Fotocopy Kutipan Akta Kelahiran;</li><li> Fotocopy Kartu Keluarga; </li><li> Fotocopy KTP-el orang tua/wali;</li><li> Pas foto berwarna ukuran 3 x 4 sebanyak 2 (dua) lembar (untuk anak usia 5 s/d 17 tahun kurang 1 (satu) hari);</li><li> Usia kurang dari 5 (Lima)  tidak pakai Pas foto </li></ol>\n<!-- /wp:list -->','Kartu Identitas Anak (KIA)','','inherit','closed','closed','','35-revision-v1','','','2020-04-06 22:49:38','2020-04-06 22:49:38','',35,'http://117.53.47.16/index.php/2020/04/06/35-revision-v1/',0,'revision','',0),(68,1,'2020-04-06 22:50:09','2020-04-06 22:50:09','<!-- wp:paragraph {\"backgroundColor\":\"vivid-green-cyan\",\"customFontSize\":20} -->\n<p style=\"font-size:20px\" class=\"has-background has-vivid-green-cyan-background-color\">Penerbitan KIA bagi Penduduk WNI yang berumur kurang dari 17 (tujuh belas) tahun dan belum kawin dengan memenuhi persyaratan : </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><